import styled from "styled-components";
import {NavLink as Link} from "react-router-dom";
import {FavBars} from "react-icons/fa";
import styledComponents from "styled-components";
import React from 'react'


function  OutNavbar(){
  return (
    <>
        <Nav>
            <NavLink to="/">
               <h1>logo</h1>
            </NavLink>
            <Bars />
            <NavMenu>
                <NavLink to="/Home" activeStyle>Home</NavLink>
                <NavLink to="/Services" activeStyle>Solutions</NavLink>
                <NavLink to="/Pricing" activeStyle>pricing</NavLink>
                <NavLink to="/ContactUs" activeStyle>ContactUs</NavLink>
            </NavMenu>
            <NavBtn>
                <NavBtnLink to="/Login">Login</NavBtnLink>
            </NavBtn>
        </Nav>
    </>
  )
}

export default OutNavbar

export const Nav = styled.nav`
 background: white;
 height: 80px;
 display: flex;
 justify-content: space-between;
 padding: 0.5rem calc((100vw - 1000px)/2);
 z-index: 10;
`

export const NavLink = styled(Link)`
    color: #000;
    display: flex;
    align-items: center;
    text-decoration: none;
    height: 0.1rem;
    cursor: pointer;

    &.active {
        color: blue;
    }
`

export const Bars = styled(FavBars)`
    display: none;
    color: white;

    @media screen and (max-width: 768px){
        display: block;
        position: absolute;
        top: 0;
        right: 0;
        transform: translate(-100%, 75%);
        font-size: 1.8rem;
        cursor: pointer;
    }
`

export const NavMenu = styled.div`
    display: flex;
    align-items: center;
    margin-right: -24px;

    @media screen and (max-width: 768){
        display: none;
    }
`

export const NavBtn = styled.nav`
    display: flex;
    align-items: center;
    margin-right: 24px;

    @media screen and (max-width: 768px){
        display: none;
    }
`

export const NavBtnLink = styled(Link)`
    border-radius:  4px;
    background:  white;
    padding: 10px 22px;
    color: #000;
    border: none;
    outline: none;
    cursor: pointer;
    transition : all 0.2s ease-in-out;
    text-decoration: none;

    &hover {
        transition: all 0.2s ease-in-out;
        background: white;
        color: blue;
    }
`
